const Nav = () =>(
    <ul>
    <li><Button id variant="contained" color="success.main">Primary</Button></li>
    <li><Button variant="contained" color='secondary'>Primary</Button></li>
    <li></li>
    <li></li>    
    </ul>
    )
    export default Nav;
